        console.log("hi")
    }
  return (
    <div className="App">
        <div className="container">
      <form onSubmit={patient_data}>
        <MDBInput className="mb-4" size="" id="patient_name" label="Name" required/>
        <MDBInput
          className="mb-4"
          type="email"
          id="patient_email"
          label="Email address"
          required
        />

        <MDBCheckbox
          wrapperClass="d-flex justify-content-center mb-4"
          id="form5Example3"
          label="I have read and agree to the terms"
          required
        />

        <MDBBtn type="submit" block>
          Submit
        </MDBBtn>
      </form>
      </div>
    </div>
  );
}
export default Createapp;
